import React from 'react';
// import Dashboard from './component/Dashboard'
import Login from './component/login';
import { BrowserRouter, Route } from 'react-router-dom';
import signUp from './component/signUp';
// import Home from './component/Home';
// import ShowAlltwite from './component/ShowAlltwite';
// import UserAllDetails from './component/UserAllDetails';
// import EditUser from './component/EditUser'
// import CreateTwite from './component/CreateTwite';
// import ShowAllUsers from './component/ShowAllUser';
// import ViewUsers from './component/ViewProfile';
// import ShowAlltwitByUser from './component/ShowAlltwitByUser';
import Dashboard from './component/Dashboad'



function App() {
  return (
    <>
      <BrowserRouter>
        {/* <Route path="/" exact component={Home} /> */}
        <Route path="/Login" render={(props) => { return (<Login  {...props} />) }} ></Route>
        <Route path="/signUp" render={(props) => { return (<signUp  {...props} />) }} ></Route>
        {/* <Route path="/createblog" component={Createblog} /> */}
        {/* <Route path="/ShowAlltwite" render={(props) => { return (<ShowAlltwite  {...props} />) }} ></Route>
        <Route path="/UserAllDetails" render={(props) => { return (<UserAllDetails  {...props} />) }} ></Route>
        <Route path="/EditUser/:user_id" render={(props) => { return (<EditUser  {...props} />) }} ></Route>
        <Route path="/CreateTwite" render={(props) => { return (<CreateTwite  {...props} />) }} ></Route>
        <Route path="/ShowAllUsers" render={(props) => { return (<ShowAllUsers  {...props} />) }} ></Route>
        <Route path="/ViewUsers/:user_id" render={(props) => { return (<ViewUsers  {...props} />) }} ></Route>
        <Route path="/ShowAlltwitByUser/:user_id" render={(props) => { return (<ShowAlltwitByUser  {...props} />) }} ></Route> */}
        <Route path="/Dashboard" render={(props) => { return (<Dashboard  {...props} />) }} ></Route>
      </BrowserRouter>
    </>
  );
}

export default App;
